import React from 'react';
import AddUser from './Users/AddUser';
import UsersList from './Users/UsersList';


function App() {
  const [usersList, setUsersList] = useState([])
  return (
    <div>
      <AddUser />
      <UsersList users={usersList}/>
    </div>
  );
}

export default App;
